import React from "react";
import Text from "../../components/Text";
import Title from "../../components/Title";


export default function MatchContent(props) {
    return(
      <div className={"lg:px-20 py-10"}>
          {props.activeTab === "prehled" && (
            <Text text={"prehled"}></Text>
          )}
          {props.activeTab === "sestavy" && (
              <Text text={"sestavy"}></Text>
          )}
          {props.activeTab === "statistiky" && (
              <Text text={"statistiky"}></Text>
          )}
          {props.activeTab === "analytika" && (
              <div>
              <Title text={"Analýza zápasu"}></Title>
                <Text text={props.analysis.content}></Text>
                </div>
          )}
          {props.activeTab === "sazeni" && (
              <Text text={"sazeni"}></Text>
          )}
      </div>
    );
}
